import React from "react";

const mySelect = () => {
  return (
    <div>
    <hr style={{ margin: '15px 0' }} />
    <select name="" id="">
      <option value="option1">hui</option>
      <option value="option2">pizda</option>
    </select>
  </div>
  )
};

export default mySelect
